<!DOCTYPE html><html lang="en"><head><meta charset="utf-8"><meta name="viewport" content="width=device-width,initial-scale=1,shrink-to-fit=no"><meta name="theme-color" content="#000000"><link rel="stylesheet" href="main.css"/><link rel="manifest" href="manifest.json"><link rel="shortcut icon" href="favicon.ico"><title>React App</title><link href="/static/css/main.c17080f1.css" rel="stylesheet"></head>
<body>
  <noscript>You need to enable JavaScript to run this app.
  </noscript>
  <div id="root"></div>
  <script type="text/javascript" src="/static/js/main.99691887.js">
  if('serviceWorker' in navigator){
       // Register service worker
        navigator.serviceWorkerContainer.register('service-worker.js').then(function(reg){
           console.log("SW registration succeeded. Scope is "+reg.scope);
       }).catch(function(err){
           console.error("SW registration failed with error "+err);
       });
   }
  </script>
</body>
</html>
